parameters.inputSchema:
{
  "type": "object",
  "required": ["action"],
  "properties": {
    "action": {
      "type": "string",
      "note": "Provide the action to perform, such as 'Create a draft' or 'Send an email'.",
      "value": "Create a draft"
    },
    "parameters": {
      "type": "object",
      "note": "Provide the necessary details for the email action.",
      "properties": {
        "senderEmailAddress": {
          "type": "string",
          "note": "The email address of the sender.",
          "value": "sender@example.com"
        },
        "recipientEmailAddress": {
          "type": "string",
          "note": "The recipient's email addresses, separated by commas if multiple.",
          "value": "recipient1@example.com,recipient2@example.com"
        },
        "ccRecipientEmailAddress": {
          "type": "string",
          "note": "CC email addresses, separated by commas if multiple.",
          "value": "cc@example.com"
        },
        "bccRecipientEmailAddress": {
          "type": "string",
          "note": "BCC email addresses, separated by commas if multiple.",
          "value": "bcc@example.com"
        },
        "subject": {
          "type": "string",
          "note": "The subject of the email.",
          "value": "Meeting Follow-Up"
        },
        "body": {
          "type": "string",
          "note": "The content of the email.",
          "value": "Hi Team,\n\nThank you for attending the meeting. Here are the action items:\n\n1. Follow up on the project.\n2. Schedule the next meeting.\n\nBest regards,\nJohn"
        },
        "messageId": {
          "type": "string",
          "note": "The ID of the message (useful for replying or forwarding).",
          "value": "12345abcdef"
        },
        "labelId": {
          "type": "string",
          "note": "The ID of the label to associate with the message.",
          "value": "label_001"
        },
        "replyToSenderOnly": {
          "type": "boolean",
          "note": "Set to true if replying only to the sender.",
          "value": true
        },
        "search": {
          "type": "string",
          "note": "A search query for finding messages.",
          "value": "project updates"
        },
        "readStatus": {
          "type": "string",
          "note": "The read status of the email ('unread', 'read', or 'both').",
          "value": "unread"
        },
        "receivedAfter": {
          "type": "string",
          "note": "Filter emails received after this date (ISO 8601 format).",
          "value": "2024-01-01T00:00:00Z"
        },
        "receivedBefore": {
          "type": "string",
          "note": "Filter emails received before this date (ISO 8601 format).",
          "value": "2024-12-31T23:59:59Z"
        },
        "senderName": {
          "type": "string",
          "note": "The name of the sender.",
          "value": "John Doe"
        },
        "newLabelName": {
          "type": "string",
          "note": "The name of the new label to create.",
          "value": "Important"
        },
        "threadId": {
          "type": "string",
          "note": "The ID of the email thread.",
          "value": "thread_001"
        },
        "draftId": {
          "type": "string",
          "note": "The ID of the draft.",
          "value": "draft_123"
        },
        "maxResults": {
          "type": "integer",
          "note": "The maximum number of messages to retrieve (limit: 50).",
          "value": 10,
          "maximum": 50
        }
      }
    }
  }
}

{
  "type": "object",
  "required": ["action"],
  "properties": {
    "action": {
      "type": "string",
      "note": "Provide the action to perform, such as 'Create an event' or 'Update an event'.",
      "value": "Create an event"
    },
    "parameters": {
      "type": "object",
      "note": "Provide the necessary details for the calendar action.",
      "properties": {
        "calendar": {
          "type": "string",
          "note": "The identifier of the calendar (e.g., email address).",
          "value": "mallory@customaistudio.io"
        },
        "start": {
          "type": "string",
          "note": "Start date and time of the event in ISO 8601 format.",
          "value": "2024-01-01T10:00:00Z"
        },
        "end": {
          "type": "string",
          "note": "End date and time of the event in ISO 8601 format.",
          "value": "2024-01-01T11:00:00Z"
        },
        "allday": {
          "type": "string",
          "note": "Specify whether the event is all-day ('yes' or 'no').",
          "value": "no"
        },
        "attendees": {
          "type": "string",
          "note": "Comma-separated list of attendees' email addresses.",
          "value": "attendee1@example.com,attendee2@example.com"
        },
        "conferenceSolution": {
          "type": "string",
          "note": "The type of conference data (e.g., 'hangoutsMeet').",
          "value": "hangoutsMeet"
        },
        "description": {
          "type": "string",
          "note": "The description or notes for the event.",
          "value": "Discussion on Q1 planning and strategy."
        },
        "repeatFrecuency": {
          "type": "string",
          "note": "Frequency of recurrence (must be 'daily', 'weekly', 'monthly', or 'yearly').",
          "value": "weekly",
          "enum": ["daily", "weekly", "monthly", "yearly"]
        },
        "summary": {
          "type": "string",
          "note": "Short description or title of the event.",
          "value": "Q1 Planning Meeting"
        },
        "eventId": {
          "type": "string",
          "note": "The unique identifier for the event.",
          "value": "event_123"
        },
        "sendUpdates": {
          "type": "string",
          "note": "Specifies whether to send updates to attendees (e.g., 'all', 'externalOnly', 'none').",
          "value": "all"
        },
        "timeMin": {
          "type": "string",
          "note": "Minimum start time for retrieving events in ISO 8601 format.",
          "value": "2024-01-01T00:00:00Z"
        },
        "timeMax": {
          "type": "string",
          "note": "Maximum end time for retrieving events in ISO 8601 format.",
          "value": "2024-01-31T23:59:59Z"
        },
        "orderBy": {
          "type": "string",
          "note": "Specifies the ordering of returned events (e.g., 'startTime').",
          "value": "startTime"
        },
        "query": {
          "type": "string",
          "note": "Search query to filter events.",
          "value": "planning"
        }
      }
    }
  }
}

{
  "type": "object",
  "required": ["action"],
  "properties": {
    "action": {
      "type": "string",
      "note": "The operation to perform on the file or folder, such as 'copy file', 'create file', 'delete folder', etc.",
      "value": "copy file"
    },
    "parameters": {
      "type": "object",
      "note": "Details required for the file/folder operation.",
      "properties": {
        "fileId": {
          "type": "string",
          "note": "Identifier for the file.",
          "value": 12312312
        },
        "fileName": {
          "type": "string",
          "note": "Name of the file.",
          "value": "example_file_name"
        },
        "description": {
          "type": "string",
          "note": "Description for the file.",
          "value": "example description"
        },
        "fileContent": {
          "type": "string",
          "note": "Content of the file.",
          "value": "example content"
        },
        "email": {
          "type": "string",
          "note": "Email address associated with the operation.",
          "value": "user@example.com"
        },
        "message": {
          "type": "string",
          "note": "Email message to the reciepient party when sharing a file or folder",
          "value": "example message"
        },
        "searchQuery": {
          "type": "string",
          "note": "Query string used when searching for files or folders.",
          "value": "example search query"
        },
        "newFolderName": {
          "type": "string",
          "note": "Name for a new folder to create.",
          "value": "example new folder"
        },
        "newFileName": {
          "type": "string",
          "note": "Name for a new file to create.",
          "value": "example new file"
        },
        "folderId": {
          "type": "string",
          "note": "Identifier for the folder.",
          "value": "example_folder_id"
        }
      }
    }
  }
}

